import {Header, Nav, Article, Image} from './main.js'
import './App.css'

const topics =  [
  {id: 1,title : "html"},
  {id: 2,title : "css"},
  {id: 3,title : "javascript"}
];


const App = ()=>{
  return(
    <>
      <Header />
      <Nav title={topics}/>
      <Image img="../images/web_img.png"/>
      <Article title="Welcom" body="Hello, WEB"/>
    </>
  );
}

export default App;
